import React from 'react';
import { Dialog } from '@material-ui/core';

const MovieCard = (props) => {
  const { open } = props;

  const posterPath = `http://image.tmdb.org/t/p/w154//${poster_path}`;

  return (
    <Dialog fullScreen open={open}>
      <img
        alt={'coco'}
        src={posterPath}
      />
    </Dialog>
  );
}

export default MovieCard;
